import "./App.css";
import "./reset.css";
import { useEffect, useState } from "react";
import React, { PureComponent } from "react";
import {
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  CartesianGrid,
  LineChart,
  Line,
} from "recharts";

const useFetchCloseData = () => {
  const [closeData, setCloseData] = useState();
  useEffect(() => {
    (async () => {
      const result = await fetch("http://localhost:8000/fx");
      const json = await result.json();
      if (json.train && json.valid) {
        const dataList = [
          ...Object.entries(JSON.parse(json.train).close),
          ...Object.entries(JSON.parse(json.valid).close),
        ].map((item) => ({ name: item[0], close: item[1] }));

        setCloseData(dataList);
        console.log(dataList);
      }
    })();
  }, []);

  return { closeData };
};
const useFetchPredictionsData = () => {
  const [predictionsData, setPredictionsData] = useState();
  useEffect(() => {
    (async () => {
      const result = await fetch("http://localhost:8000/fx");
      const json = await result.json();
      if (json.train && json.valid) {
        const dataList = [
          // ...Object.entries(JSON.parse(json.train)["Predictions"]),
          ...Object.entries(JSON.parse(json.valid)["Predictions"]),
        ].map((item) => ({ name: item[0], predictions: item[1] }));

        setPredictionsData(dataList);
        console.log(dataList);
      }
    })();
  }, []);

  return { predictionsData };
};

function App() {
  const { closeData } = useFetchCloseData();
  const { predictionsData } = useFetchPredictionsData();

  const dataSet = closeData &&
    predictionsData && { ...closeData, ...predictionsData };

  console.log(dataSet);
  return (
    <div>
      {/* {JSON.stringify(data)} */}

      <LineChart
        width={500}
        height={300}
        data={dataSet}
        margin={{
          top: 5,
          right: 30,
          left: 20,
          bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Line
          type="monotone"
          dataKey="close"
          stroke="#8884d8"
          // activeDot={{ r: 8 }}
        />
        <Line
          type="monotone"
          dataKey="predictions"
          stroke="#82ca9d"
          activeDot={{ r: 8 }}
        />
      </LineChart>
    </div>
  );
}
export default App;

const a = [
  { name: "0", a: 111 },
  { name: "1", a: 222 },
];

const b = [
  {
    nane: "1",
    b: 777,
  },
];

const correct = [
  { name: "0", a: 111 },
  { name: "1", a: 222, b: 777 },
];
